import {combineReducers} from "redux";

import userReducer from "./userReducer";
import gameReducer from "./gameReducer";
import appReducer from "./appReducer";

export const rootReducer = combineReducers({
    user: userReducer,
    app:appReducer,
    game: gameReducer
})

